/* menu CSS */
if (typeof GM_addStyle == 'undefined') {
	function GM_addStyle(css) {
		var head = document.getElementsByTagName('head')[0];
		if (head) {
			var style = document.createElement("style");
			style.type = "text/css";
			style.appendChild(document.createTextNode(css));
			head.appendChild(style);
			}
		}
	}	
function setMenuCSS(rtl) {
	GM_addStyle([
			"#x_gmjct_ytnfa_menu {background-color: dimgray; color: white; margin: 0; padding: 3px; border: solid #CCCCCC 1px; width: ;}",
			"#x_gmjct_ytnfa_menu p {margin: 0; padding: 0 5px;}",
			"img.x_gmjct_ytnfa_flagicon {vertical-align: baseline; margin: " + (rtl ? "0 0 0 3px" : "0 3px 0 0") + ";}",
			"#x_gmjct_ytnfa_flagbutton {margin-left: 1em;}"
		].join("\n"));
}

function init() {
	var div_node = null, paragraph_node = null, button_node = null;
	var startMain;
	var matched;
	var country_code;
	comments_view = document.getElementById("comments-view");
//	opera.postError('started');
	if (comments_view) {
//		opera.postError('comments were found');
		if (document.head) 
			if (matched=document.head.innerHTML.match(reg_lang_code)) 
				lang_id=lang_list[matched[1]];
		if (!lang_id) lang_id=0;
		if (lang_id > 1) {	// not English
			for (country_code in country_names) {
				decoded_country_names[country_code] = atob_utf8(country_names[country_code][lang_id]);
			}
		}
		else {
			for (country_code in country_names) {
				decoded_country_names[country_code] = country_names[country_code][lang_id];
			}
		}
		setMenuCSS(document.dir == "rtl");
		startMain = function (event) {
			if (event && button_node && paragraph_node && div_node) {
				button_node.removeEventListener("click", startMain, false);
				paragraph_node.removeChild(button_node);
				div_node.removeChild(paragraph_node);
				div_node.parentNode.removeChild(div_node);
				delete div_node;
				delete paragraph_node;
				delete button_node;
			}
			setUsersCountry();
			var monitorCommentList=setInterval(function() {
				counter++;
				if (bodyText!=document.body.textContent||counter==6) {
					bodyText=document.body.textContent;
					counter=0;
					randomFlag=Math.random();
					setUsersCountry();
				}
			}, monitoring_interval);
		}

		if (document.location.pathname.indexOf("/all_comments") == 0) {
			div_node = document.createElement("div");
			div_node.id = "x_gmjct_ytnfa_menu";
			div_node.setAttribute("class", "live-comments-setting")
			paragraph_node = document.createElement("span");
			button_node = document.createElement("input");
			button_node.id = "x_gmjct_ytnfa_flagbutton";
			button_node.setAttribute("class", "yt-uix-button yt-uix-button-default yt-uix-tooltip");
			button_node.setAttribute("role", "button");
			button_node.setAttribute("type", "button");
			button_node.setAttribute("data-tooltip-text", "Display National Flags");
			button_node.setAttribute("value", decodeURI(button_value[[0, 0, 2, 3, 4, 4, 6, 7, 7, 9, 10, 11, 12, 13][lang_id] || 0]));
			button_node.addEventListener("click", startMain, false);
			paragraph_node.appendChild(document.createTextNode(""));
			paragraph_node.appendChild(button_node);
			div_node.appendChild(paragraph_node);
			comments_view.parentNode.insertBefore(div_node, comments_view);
		}
		else {
			startMain(null);
		}
	}
}

